import dill as pickle
import base64
import json
import sys
import k8s



func = k8s.deserialize_func("")

deps = []
if len(deps) != 0:
  inputs = {dep: k8s.wait(dep, delete=False) for dep in deps}
else:
  inputs = dict()

if k8s.check_for_kwargs(func):
  json.dump(func(inputs=inputs), sys.stdout)
else:
  json.dump(func(), sys.stdout)

